import React from "react";
import "./style.css";

export default function NewTask(newTask, handleChange, handleSubmit) {
  return (
    <form onSubmit={handleSubmit}>
      <input
        type="text"
        name="title"
        placeholder="enter new task"
        value={newTask.title || ""}
      />
    </form>
  );
}
